%[text] # Table Widget
%[text] This live script demonstrates basic usage of the custom Table component: 
%[text] - Create sample data
%[text] - Construct the Table
%[text] - Show filtering, grouping, sorting, selection, and styling 
%[text] - Hook callbacks to observe interactions \
%[text] ### Create sample data
%[text] Create a sample table with numeric, categorical, and text columns.
n = 30; 
T = table; 
T.ID = (1:n).'; 
T.Category = categorical(randi([1 4], n, 1), 1:4, ["A","B","C","D"]); 
T.Group = categorical(randi([1 5], n, 1), 1:5, compose("G%d", 1:5)); 
T.Value = randn(n,1) * 10 + 50; T.Note = arrayfun(@(x) "Row" + x, (1:n).', 'UniformOutput', false) %[output:331202a1]
%%
%[text] ### Create the widget
fig = figure('Name','Table Widget Demo','WindowStyle',"docked"); %[output:93d21619]
gl = uigridlayout(fig, [1,1]); %[output:93d21619]
%%
%[text] Construct the Table widget using name-value pairs supported by the class 
tb = gwidgets.Table(Parent=gl, Data=T, ColumnEditable=true); %[output:9c9496a0]
%%
%[text] ### Enable features
%[text] Enable the row filter control 
tb.HasToggleFilter = true; tb.ShowRowFilter = true; %[output:3b2f063b]
%%
%[text] Make grouping-related features available 
tb.HasChangeGroupingVariable = true; tb.HasToggleShowEmptyGroups = true; %[output:920e293e]
%%
%[text] Allow sorting on the Value column only 
tb.ColumnSortable = true; tb.HasColumnSorting = true; %[output:97b5d629]
%%
%[text] Allow cell selection and column selection (context menu will show both) 
tb.SupportedSelectionTypes = ["cell","column"]; %[output:3de359fa]
%%
%[text] ### Grouping example (programmatic)
%[text] Group by 'Group' column 
tb.GroupingVariable = "Category";  %[output:06eb7c65]
%[text] Open all groups 
tb.openAllGroups(); %[output:06eb7c65]
%%
%[text] ###  Filtering example (programmatic)
%[text] Restrict to Category A and B using the Filter controller API 
%[text] The widget exposes FilterController to set filter programmatically. 
%[text] Set the high-level Filter property (string or filter object)
tb.Filter = "Category = A|B"; %[output:24a598a8]
%%
%[text] ### Sorting example
%[text] Sort by Value descending 
tb.SortByColumn = "Value";  %[output:38abd7b5]
tb.SortDirection = "Descend"; %[output:38abd7b5]
%%
%[text] Selection and callbacks
%[text] Cell clicked callback: show selected data indices and values in the command window. 
tb.CellClickedCallback = @(src, evt) fprintf("CellClicked: DataIdx = %s, DisplayIdx = %s"+newline, mat2str(evt.Indices), mat2str(evt.DisplayIndices)); %[output:16d1eba2]
%%
%[text] ## Add a custom context menu item
m = uimenu("Text","Export Visible Rows","MenuSelectedFcn",@(s,e) assignin('base','ExportedVisible', tb.DisplayData));  %[output:5d823934]
tb.addContextMenuItem(m); %[output:5d823934]
%%
%[text] ## Custom style example
%[text] Create a style that highlights rows with Value \> 60
s = matlab.ui.style.Style(BackgroundColor=[0.8 0.2 0.5]);
%[text] target function takes the Table object 
%[text] Apply a "row" style using the widget's addStyle API. SelectionMode "Display" makes the style use visible selection mapping.
tb.removeStyle() %[output:448c7ae8]
tb.addStyle(s, "row", "Value>48", SelectionMode=gwidgets.internal.table.SelectionMode.Display); %[output:448c7ae8]

